import action from "../action"
const initialState={
    data:[],
    isLoggedIn:false
}
const reducer =(state=initialState,action)=>{
    switch(action.type){
        case 'SET_LOGED_IN_USER_DATA':
        return {
            ...state
        }
    }

}
